ust not be used by any other choice or item variable. An identifier is a string of characters that must start with a Letter or an underscore ("_") and contain only Letters, underscores, hyphens ("-"), period (".", a.k.a. full-stop), Digits, CombiningChars and Extenders.' => 'Heiti valkostsins. Heitið má ekki nota með neinum öðrum valkosti eða atriðisbreytu. Heiti er strengur tákna sem verður að byrja með Bókstaf eða undirstriki ("_") og aðeins mega vera Bókstafir, undirstrik, bandstrik ("-"), punktur ("."), Tölustarfir, TengiStafir og Lengingar.','The identifier of the choice. This identifier must not be used by any other response or item variable. An identifier is a string of characters that must start with a Letter or an underscore ("_") and contain only Letters, underscores, hyphens ("-"), period (".", a.k.a. full-stop), Digits, CombiningChars and Extenders.' => 'Heiti valkostsins. Heitið má ekki nota með neinu öðru svari eða atriðisbreytu. Heiti er strengur tákna sem verður að byrja með Bókstaf eða undirstriki ("_") og aðeins mega vera Bókstafir, undirstrik, bandstrik ("-"), punktur ("."), Tölustarfir, TengiStafir og Lengingar.','The identifier of the modal feedback. This identifier must not be used by any other modal feedback or item variable. An identifier is a string of characters that must start with a Letter or an underscore ("_") and contain only Letters, underscores, hyphens ("-"), period (".", a.k.a. full-stop), Digits, CombiningChars and Extenders.' => 'Heiti háttarendurgjafar. Þetta heiti má ekki nota af neinni annarri háttarendurgjöf eða atriðisbreytu. Heiti er strengur tákna sem verður að byrja á Bókstaf eða undirstriki ("_") og má aðeins innihalda Bókstafi, undirstrik, bilstrik ("-"), punkt ("."), Tölur, TengiTákn og Framhaldstákn.','The identifier of the response identifier. This identifier must not be used by any other response or item variable. An identifier is a string of characters that must start with a Letter or an underscore ("_") and contain only Letters, underscores, hyphens ("-"), period (".", a.k.a. full-stop), Digits, CombiningChars and Extenders.' => 'Heitið á heiti svarsins. Þetta heiti má ekki nota af neinu öðru svari eða atriðisbreytu. Heiti er strengur tákna sem verður að byrja á Bókstaf eða undirstriki ("_") og má aðeins innihalda Bókstafi, undirstrik, bilstrik ("-"), punkt ("."), Tölur, TengiTákn og Framhaldstákn.','The IMS QTI Item could not be imported.' => 'Ekki var hægt að flytja inn IMS QTI Atriðið.','The item needs to be saved before it can be previewed' => 'Atriðið þarf að vista áður en hægt er að forskoða það','The item of the qti item. It is currently used as a meta data only. It is required by the QTI standard.' => 'Atriðið af qti atriðinu. Það er nú notað sem skýringagagn. QTI staðallinn krefst þess.','The left position of the shape relative to the top left corner of the background in pixels. This value may be scaled when the background image size is adapted to it\'s container' => 'Vinstri staða reitsins í samanburði við efra vinstra horn bakgrunnsins í pixlum. Gildið má skala þegar stærð bakgrunnsmyndarinnar er löguð að svæðinu.','The loop attribute is used to set continuous play mode. In continuous play mode, once the media object has started to play it should play continuously (subject to maxPlays).' => 'Lykkjueiginleikinn er notaður til að stilla á samfella spilun. Í samfelldri spilun á miðillinn að spila stöðugt eftir að hann byrjar (takmarkast af maxPlays).','The lower bound of the slider' => 'Neðri mörk rennistyku','The manifest argument must be an instance of DOMDocument.' => 'Röksemd í heildarskrá verður að vera tilvik í DOMDocument.','The maximum number of association is unlimited.' => 'Heildarfjöldi vensla er ótakmarkaður.','The maximum number of associations that the candidate is allowed to make.' => 'Hámarksfjöldi vensla sem próftaki má búa til.','The maximum number of choices that the candidate is allowed to select.' => 'Hámarksfjöldi valkosta sem próftaki má velja.