Items can be displayed either randomly or in a specific order.' => 'Ákvarða röð atriða þinna. Atriði má sýna annað hvort tilviljanakennt eða í ákveðinni röð.','Discover how easy it is to create an assessment with TAO!' => 'Sjá hve einfalt er að búa til mat með TAO!','Do not show this window again when TAO opens.' => 'Sýnið ekki þennan glugga aftur þegar TAO opnar.','Export Test Results' => 'Flytja út Prófniðurstöður','For example:' => 'Til dæmis:','Go to' => 'Fara í','Help' => 'Hjálp','Hint: "Simple” tests without any hierarchy are also available. Note that Open Web Items (OWI) can be delivered in simple test mode only.' => 'Vísbending: "Einföld" próf án nokkurrar yfirbyggingar eru líka fáanleg. Takið eftir að Opin vefatriði (OWI) er aðeins hægt að fá sem einföld próf.','Hint: You can access this overview at any time via the Help button.' => 'Vísbending: Alltaf er hægt að komast í þetta yfirlit með Hjálparhnappnum.','If your needs go beyond what the QTI standard allows, you can develop powerful and sophisticated item types using the TAO Open Web Item format.' => 'Ef þarfir þínar eru meiri en QTI staðallinn leyfir er hægt að þróa öflugar og þróaðar atriðisgerðir með því að nota TAO Opna vefatriða sniðið.','Import / Export Tests' => 'Flytja inn / Flytja út próf','Import and Export Items' => 'Flytja inn / Flytja út atriði','Import any items that are compliant with the QTI (Question and Test Interoperability) 2.1 standard.' => 'Flytja inn öll atriði sem falla að QTI (Question and Test Interoperability) 2.1 staðlinum.','Import test-takers' => 'Flytja inn próftaka','In addition to creating test-takers individually by manually entering their corresponding data, you can mass-create test-taker records by importing them from a CSV file.' => 'Auk þess að búa til próftaka hvern fyrir sig með því að skrá inn viðeigandi gögn þeirra, er hægt að búa til margar próftakaskrár með því að flytja þá inn af CSV skrá.','In TAO, tests are assigned to groups.' => 'Í TAO er prófum úthlutað til hópa.','Item(s)' => 'Atriði','Manage Reports' => 'Skýrslustjórnun','Multiple choice' => 'Fjölval','Order of items – sequential or random' => 'Röð atriða - ákveðin eða tilviljanakennd','Overview' => 'Yfirlit','Preview Items' => 'Forskoða atriði','Publish' => 'Birta','QTI Test Structure' => 'QTI Próf Uppbygging','Register your test-takers, manage their personal data, and assign them to groups.' => 'Skrá próftaka, sýsla með einkagögn þeirra og setja þá í hópa.','Results' => 'Niðurstöður','See how your items will appear to the test-taker before running the test. Previews are available for both desktop or mobile devices.' => 'Sjá hvernig atriði þín birtist próftakanum áður en prófið er tekið. Forskoðun er möguleg fyrir bæði borðtölvur eða spjaldtölvur og farsíma.','Select an icon on the left to find out more.' => 'Veldu tákn til vinstri til að sjá meira.','Select the delivery dates.' => 'Veldu fyrirlagnardagsetningar.','Select the group(s) that will take the test. You can exclude individual test-takers even if they are part of the group.' => 'Veldu hóp(a) sem taka prófið. Hægt er að undanskilja einstaka próftaka jafnvel þótt þeir seu hluti af hópnum.','Select the test you want to deliver to your group(s) of test-takers. Publish it to make it available online.' => 'Veldu prófið sem þú vilt leggja fyrir hóp/hópa próftaka. Birtu það svo það verði tækt á netinu.','selection' => 'val','Single choice' => 'Einn möguleiki');